.gutter .line-number.linter-info .icon-right {
  visibility: visible;
}
.gutter .line-number.linter-info .icon-right:before {
  color: #1492ff;
  content: "\f052";
  font-size: 1.1em;
}
.gutter .line-number.linter-warning .icon-right {
  visibility: visible;
}
.gutter .line-number.linter-warning .icon-right:before {
  color: #d5880b;
  content: "\f052";
  font-size: 1.1em;
}
.gutter .line-number.linter-error .icon-right {
  visibility: visible;
}
.gutter .line-number.linter-error .icon-right:before {
  color: #f42a2a;
  content: "\f052";
  font-size: 1.1em;
}
